import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/homepage';
import PostDetailed from './components/post';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/'>
          <>
          <HomePage />
          </>
        </Route>
      </Routes>
    </Router>
  )
}

export default App
